function processItem(item, next) {
    if (!item.hasOwnProperty('style')) {
        return next();
    }
    switch (item.style.split(';')[0]) {
        case 'swimlane': //Model
            return next(null, {
                id: item.id,
                value: item.value,
                type: 'model'
            });
            break;
        case 'text': //Attribute
            return next(null, {
                id: item.id,
                value: item.value,
                parent: item.parent,
                type: 'attribute'
            });
            break;
        default:
            return next();
            break;
            /*case :'edgeStyle=orthogonalEdgeStyle' //Relation
        break; */
    }
}

parseString(xml, function(err, result) {
    async.each(result, function(item, next) {
        async.each(item.root, function(rootItem, next) {
            async.each(rootItem.mxCell, function(mxCellItem, next) {
                processItem(mxCellItem['$'], function(err, model) {
                    if (err || !model) {
                        return next();
                    }
                    switch (model.type) {
                        case 'model':
                            /*console.log('-----------------------------');
                            console.log('', model.value);
                            console.log('-----------------------------');*/
                            var _model = new Object();
                            _model[model.id] = {
                                name: model.value
                            };
                            models.push(_model);
                            break;
                        case 'attribute':
                            //console.log('', model.value);
                            var _attribute = {
                                id: model.id,
                                parent: model.parent,
                                name: striptags(model.value).split(': ')[0],
                                type: striptags(model.value).split(': ')[1]
                            };
                            attributes.push(_attribute);
                            break;
                    }
                    next();
                });
            }, next);
        }, next)
    }, function() {
        console.log('', models);
        console.log('', attributes);
    });
});
